"use strict";module.exports=exports;var url=require("url");var URI_REGEX="^(.*).(s3(?:-.*)?).amazonaws.com$";module.exports.detect=function(e,b){var d=url.parse(e);var c=d.hostname.match(URI_REGEX);b.prefix=(!d.pathname||d.pathname=="/")?"":d.pathname.replace("/","");if(!c){return}if(!b.bucket){b.bucket=c[1]}if(!b.region){var a=c[2];if(a.slice(0,3)=="s3-"&&a.length>=3){b.region=a.replace("s3-","")}}};